CREATE TABLE tbase:informix.teces_dbs03 (
	tecesnces integer NOT NULL,
	tecesntra integer NOT NULL,
	tecesttra smallint NOT NULL,
	tecesform char(1) NOT NULL,
	teceseant smallint NOT NULL,
	tecesfant date NOT NULL,
	teceshant char(8),
	teceseact smallint NOT NULL,
	tecesfact date,
	teceshact char(8),
	tecesdesc char(300),
	tecesuser char(3),
	teceshora char(8),
	tecesfpro date
);

load FROM teces_dbs03.txt INSERT INTO teces_dbs03;

SELECT *
FROM teces a
WHERE a.tecesfpro = '2025-02-02'
AND EXISTS (SELECT *
			FROM teces_dbs03 b
			WHERE b.tecesntra = a.tecesntra
			AND b.tecesfpro = a.tecesfpro
			AND b.teceshora = a.teceshora
			AND b.tecesuser = a.tecesuser);

SELECT *
FROM teces_dbs03 a
WHERE a.tecesfpro = '2025-02-02'
AND NOT EXISTS (SELECT *
			FROM teces b
			WHERE b.tecesntra = a.tecesntra
			AND b.tecesfpro = a.tecesfpro
			AND b.teceshora = a.teceshora
			AND b.tecesuser = a.tecesuser);


